import React from 'react';

import { NavigationContainer } from '@react-navigation/native'; // Importamos la navegación "navigation"
import { createNativeStackNavigator } from '@react-navigation/native-stack'; // Importamos la navegación "navigation"

import Login from './components/login';
import Car from './components/car';
import Rent from './components/rent';
import CarList from './components/carList';
import RentList from './components/rentList';

import { AppProvider } from './AppContexts'; // Importa el AppProvider

const Stack = createNativeStackNavigator();

export default function App() {

    return (

       <NavigationContainer>

            <AppProvider> {/* Envolver las rutas con el AppProvider, para acceder a los arrays en todas las screens */}

                <Stack.Navigator 
                    initialRouteName='Log'
                    screenOptions={{
                        headerShown: false, // Oculta la barra de navegación
                        headerBackVisible: true, // Oculta la flecha de retroceso
                    }}
                >
                    <Stack.Screen name="Login" component={Login} />
                    <Stack.Screen name="Car" component={Car} />
                    <Stack.Screen name="CarList" component={CarList} />
                    <Stack.Screen name="Rent" component={Rent} />
                    <Stack.Screen name="RentList" component={RentList} />
                </Stack.Navigator>

            </AppProvider>

        </NavigationContainer>

    );
};
